import React from "react";

const RandomPage = () => {
  return (
    <div>
      <text>
        This is a random page! If you want to go back to the home page, click
        that buttom below!
        <button type="button" className="btn btn-primary">
          + Create Deck
        </button>
      </text>
    </div>
  );
};

export default RandomPage;
